class Solution(object):
	def solve(self, board):
		"""
		:type board: List[List[str]]
		:rtype: void Do not return anything, modify board in-place instead.
		"""
		def flip(i,j,board,row,column):
			if board[i][j] == "2":
				return True
			if board[i][j] == "X":
				return True
			elif board[i][j] == "O":
				temp = list(board[i])
				temp[j] = "2"
				board[i] = "".join(temp)
				if (i==0 or j==0 or j == column-1 or i== row-1):
					temp[j] = "2"
					board[i] = "".join(temp)
					return False
				if flip(i-1,j,board,row,column) and flip(i,j-1,board,row,column) and flip(i+1,j,board,row,column) and flip(i,j+1,board,row,column):
					temp[j] = "X"
					board[i] = "".join(temp)
					return True
				else:
					temp[j] = "1"
					board[i] = "".join(temp)
					return False
		if len(board) == 0:
			return
		row,column = len(board),len(board[0])
		for i in xrange(row):
			for j in xrange(column):
				if board[i][j] == "O":
					flip(i,j,board,row,column)
		for i in xrange(row):
			for j in xrange(column):
				if board[i][j] == "1" or board[i][j]=="2":
					temp = list(board[i])
					temp[j] = "O"
					board[i] = "".join(temp)
